import React from "react";
import { ThemeContext } from "../../context/Theme";
import logo from "../../../src/assets/logo1.png";

const ItemCard = () => {
  return (
    
    <div className="max-w-xs mx-auto bg-white shadow-lg rounded-lg overflow-hidden m-4 min-w-20">
    <img className="w-full" src={logo} alt="card" />
    <div className="p-4">
      <h1 className="text-gray-900 font-bold text-xl mb-2">Card Title</h1>
      <p className="text-gray-600 text-base">Card Description goes here.</p>
      <div className="mt-4">
        <button className="bg-blue-500 text-white px-4 py-2 rounded mr-2">Button 1</button>
        <button className="bg-green-500 text-white px-4 py-2 rounded">Button 2</button>
      </div>
    </div>
  </div>
    );
};

export default ItemCard;
